import Start from "views/Start.jsx";
import UnderConstruction from "views/UnderConstruction.jsx"


const routes = [
  {
    path: "/start",
    name: "Start",
    rtlName: "لوحة القيادة",
    icon: "tim-icons icon-chart-pie-36",
    component: Start,
    layout: "/home"
  },
  {
    path: "/aboutme",
    name:"About Me",
    rtlName: "لوحة القيادة",
    icon: "tim-icons icon-chart-pie-36",
    component: UnderConstruction,
    layout: "/home"
  }
];

export default routes;
